/** @format */

import React from "react";

const App = () => {
	return (
		<>
			<iframe
				width='425'
				height='350'
				frameborder='0'
				scrolling='no'
				marginheight='0'
				marginwidth='0'
				src='https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap'
				></iframe>
			<br />
			<small>
				<a href='https://www.openstreetmap.org/#map=2/41.0/15.8&amp;layers=C'>
					View Larger Map
				</a>
			</small>
		</>
	);
};

export default App;

